import classes from "./Header.module.css";
import CartButton from "./HeaderCartButton";

function Header() {
  return (
    <div className={classes.header}>
      <div>React Meals</div>
      <CartButton itemCount="1"></CartButton>
    </div>
  );
}

export default Header;
